import styled from "styled-components";

export const Input = styled.input`
  outline: none;
  padding: 16px 20px;
  width: 100%;
  border-radius: 5px;
  font-size: 16px;
  margin: 1em;
  background-color: #f0f2f5;
  border: none;
`;
